// interfaces/IFoodApp.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "../structs/FoodTypes.sol";

interface IFoodApp {
    // --- Events ---
    event RestaurantRegistered(uint128 indexed restaurantId, address indexed ownerAddress);
    event StaffAssignedToRestaurant(uint128 indexed restaurantId, address indexed staffAddress, address indexed assignerAddress);
    event ServiceFeePercentageSet(uint8 newPercentage, address indexed setterAddress);

    event MenuItemAdded(uint128 indexed menuId, uint128 indexed restaurantId, string name);
    event MenuItemUpdated(uint128 indexed menuId, uint128 indexed restaurantId);
    event MenuItemRemoved(uint128 indexed menuId, uint128 indexed restaurantId);
    event MenuItemRatedByAdmin(uint128 indexed menuId, uint128 indexed restaurantId, uint8 ratingValue, address indexed adminRater); // Đổi tên event này

    event OrderPlaced(uint128 indexed orderId, address indexed customerAddress, uint128 totalPrice);
    event OrderStatusUpdated(uint128 indexed orderId, OrderStatus newStatus, address indexed updaterAddress);
    event OrderCancelled(uint128 indexed orderId, address indexed cancellerAddress, uint256 amountRefunded);
    event OrderCompleted(uint128 indexed orderId, address indexed completerAddress);

    event FoodRatedByCustomer(uint128 indexed menuItemId, uint128 indexed restaurantId, address indexed customerAddress, uint8 ratingValue, string commentText); // Event mới cho đánh giá món ăn
    event EmployeeRatedByCustomer(address indexed employeeAddress, address indexed customerAddress, uint128 indexed restaurantId, uint8 ratingValue, string commentText); // Đổi tên event và tham số
    event RestaurantRatedByCustomer(uint128 indexed restaurantId, address indexed customerAddress, uint8 ratingValue, string commentText); // Đổi tên event và tham số

    // --- Manager and RoleAccess Contract Setters ---
    function setMenuManager(address menuManagerAddress) external;
    function setRestaurantManager(address restaurantManagerAddress) external;
    function setOrderManager(address orderManagerAddress) external;
    function setRatingManager(address ratingManagerAddress) external;
    function setRoleAccessContract(address roleAccessContractAddress) external;

    // --- Functions to be called by Managers ---
    // Restaurant Management
    function registerRestaurant(address restaurantOwnerAddress, string memory restaurantName) external returns (uint128);
    function assignStaffToRestaurantInCore(uint128 restaurantId, address staffAddressToAssign) external;
    function setServiceFeePercentageInCore(uint8 percentage) external;

    // Menu Management
    function addMenuItem(uint128 restaurantId, uint128 menuId, string memory itemName, string memory imageUrl, string memory videoUrl, uint128 price, string memory description, string memory category, uint128 preparationTime) external;
    function updateMenuItem(uint128 restaurantId, uint128 menuId, string memory itemName, string memory imageUrl, string memory videoUrl, uint128 price, bool isAvailable, string memory description, string memory category) external;
    function removeMenuItem(uint128 restaurantId, uint128 menuId) external;
    function rateMenuItemByAdmin(uint128 restaurantId, uint128 menuId, uint8 ratingValue, address adminRaterAddress) external; // Đổi tên hàm, raterAddress là Admin

    // Order Management
    function placeOrder(address customerAddress, uint128 restaurantId, OrderItemDetail[] memory itemsToOrder, uint256 paidAmountByCustomer) external payable returns (uint128 orderId, uint128 totalPrice);
    function updateOrderStatus(uint128 orderIdToUpdate, OrderStatus newStatus, address updaterAddress) external;
    function cancelOrder(uint128 orderIdToCancel, address cancellerAddress) external returns (bool success, uint256 amountRefunded);
    function completeOrder(uint128 orderIdToComplete, address completerAddress) external;

    // Rating Management (Called by RatingManager, raterAddress is the Customer)
    function rateFoodItem(address raterAddress, uint128 menuItemId, uint128 restaurantId, uint8 ratingValue, string memory commentText) external; // Hàm mới cho đánh giá món ăn
    function rateGivenEmployee(address raterAddress, address employeeAddress, uint128 restaurantId, uint128 orderId, uint8 ratingValue, string memory commentText) external; // Đổi tên và thêm orderId
    function rateGivenRestaurant(address raterAddress, uint128 restaurantId, uint8 ratingValue, string memory commentText) external; // Đổi tên

    // --- Getter Functions ---
    function getRoleAccessContractAddress() external view returns (address);

    function nextRestaurantId() external view returns (uint128);
    function nextOrderId() external view returns (uint128);
    function nextMenuId() external view returns (uint128);
    function nextRestaurantReviewId() external view returns (uint128); // Getter cho ID đánh giá
    function nextFoodReviewId() external view returns (uint128);      // Getter cho ID đánh giá
    function nextEmployeeReviewId() external view returns (uint128);  // Getter cho ID đánh giá


    function staffRestaurant(address staffAddress) external view returns (uint128);
    function restaurantOwners(uint128 restaurantId) external view returns (address);
    function menuByRestaurant(uint128 restaurantId, uint128 menuId) external view returns (MenuItem memory);
    function orders(uint128 orderId) external view returns (Order memory);

    function getOrderDetailsList(uint128 orderId) external view returns (OrderItemDetail[] memory);
    function ownerRestaurants(address ownerAddress) external view returns (uint128[] memory);
    function restaurantMenuIds(uint128 restaurantId) external view returns (uint128[] memory);
    
    function getRestaurantReviews(uint128 restaurantId) external view returns (RatingForRestaurant[] memory); // Đổi tên getter
    function getFoodReviews(uint128 menuItemId) external view returns (RatingForFood[] memory);           // Getter mới
    function getEmployeeReviews(address employeeAddress) external view returns (RatingForEmployee[] memory); // Đổi tên getter và kiểu trả về

    function serviceFeePercentage() external view returns (uint8);
    function getRestaurantOrderIds(uint128 restaurantId) external view returns (uint128[] memory);

    // Helper/View functions
    function restaurantExists(uint128 restaurantId) external view returns (bool);
    function menuExists(uint128 restaurantId, uint128 menuId) external view returns (bool);

    // Các hàm tổng hợp dữ liệu
    function getMenuItems(uint128 restaurantId, uint128 startIndex, uint128 limitCount) external view returns (MenuItem[] memory);
    function getMyOrders(address customerAddress) external view returns (Order[] memory);
    function getAllOrders(uint128 startIndex, uint128 limitCount) external view returns (Order[] memory);
    function getOrderDetails(uint128 orderId) external view returns (Order memory orderInfo, MenuItem[] memory menuItems, uint128[] memory quantities);
}

